Раджвир Сингх &#151; механик гоночной команды, у которого появился шанс участвовать в гонках. Его открыл менеджер команды &laquo;Спидинг сэддлс&raquo; &#151; Гарри. В тот же день он случайно встречает студентку музыкального колледжа Радхику и влюбляется в нее. В то время, как его карьера начинала набирать обороты, его личная жизнь также расцветала после бурного романа. 

Спустя несколько месяцев он становится счастливым мужем и одним из лучших гонщиков страны. Вскоре Радж становится гонщиком N1, а так же как и гордым отцом двух детей, которых они с женой называют Принцесса и Чемпион. Но однажды в результате аварии Радж попадает на несколько месяцев в больницу. Когда он делает попытку возвратиться, он осознает, что после аварии у него появился страх перед гонками. Его жизнь теперь изменяется к худшему и после серии неудач он вынужден продать дом с аукциона и переехать&#133;

Однако, Радж и Радхика решают не рассказывать детям правду&#133; Семья борется за выживание в тех условиях, к которым они не привыкли, используя смесь фантазии и веселья, чтобы преодолеть все напасти. Но один случай заставляет Раджвира вспомнить о той жизни, которую он потерял&#133;
